INSERT INTO "Clinics" ("id", "address", "descriptionHTML", "descriptionMarkDown", "image", "name", "createdAt", "updatedAt") VALUES
(6, 'Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108 ', '<p>Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)\nLựa chọn gói khám từ cơ bản đến chuyên sâu theo nhu cầu\nGiảm thời gian chờ đợi: Không phải xếp hàng làm thủ tục khám và ưu tiên khám trước\nHỗ trợ thực hiện chụp chiếu, xét nghiệm, cận lâm sàng</p>\n', 'Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)\nLựa chọn gói khám từ cơ bản đến chuyên sâu theo nhu cầu\nGiảm thời gian chờ đợi: Không phải xếp hàng làm thủ tục khám và ưu tiên khám trước\nHỗ trợ thực hiện chụp chiếu, xét nghiệm, cận lâm sàng', 'data:image/jpeg;base64,', 'Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', '2023-04-23 16:12:49', '2023-04-23 16:12:49');
INSERT INTO "Clinics" ("id", "address", "descriptionHTML", "descriptionMarkDown", "image", "name", "createdAt", "updatedAt") VALUES
(7, 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', '<p>Địa chỉ:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<p>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\nThời gian làm việc: Thứ 2 đến thứ 7</p>\n<p>Sáng: 7h00 - 12h00\nChiều: 13h30 - 16h30\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n', 'Địa chỉ:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\nSố 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\nThời gian làm việc: Thứ 2 đến thứ 7\n\nSáng: 7h00 - 12h00\nChiều: 13h30 - 16h30\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. ', 'data:image/jpeg;base64,', 'Bệnh viện Hữu nghị Việt Đức', '2023-04-23 17:22:26', '2023-04-23 17:22:26'),
(8, '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', '<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p>Địa chỉ bệnh viện:\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n', 'Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\nĐịa chỉ bệnh viện:\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', 'data:image/jpeg;base64,', 'Bệnh viện Chợ Rẫy', '2023-04-23 17:22:49', '2023-04-23 17:22:49');
INSERT INTO "Clinics" ("id", "address", "descriptionHTML", "descriptionMarkDown", "image", "name", "createdAt", "updatedAt") VALUES
(9, '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', '<p>Từ nay, người bệnh có thể đặt khám Bệnh viện Ung bướu Hưng Việt thông qua hệ thống đặt khám BookingCare:</p>\n<ul>\n<li>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm</li>\n<li>Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)</li>\n<li>Đặt lịch khám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khám</li>\n<li>Nhận hướng dẫn chi tiết sau khi đặt lịch</li>\n</ul>\n', 'Từ nay, người bệnh có thể đặt khám Bệnh viện Ung bướu Hưng Việt thông qua hệ thống đặt khám BookingCare:\n\n* Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm\n* Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch) \n* Đặt lịch khám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khám\n* Nhận hướng dẫn chi tiết sau khi đặt lịch', 'data:image/png;base64,', ' Bệnh viện Ung bướu Hưng Việt', '2023-04-23 17:23:28', '2023-04-23 17:23:28'),
(10, 'Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội', '<p>Hãy đặt lịch khám với Hệ thống Y tế Thu Cúc TCI trên Nền tảng Y tế Chăm sóc sức khỏe toàn diện BookingCare:</p>\n<ul>\n<li>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm</li>\n<li>Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)</li>\n<li>Khám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng</li>\n<li>Nhận được hướng dẫn đi khám chi tiết sau khi đặt lịch</li>\n</ul>\n', 'Hãy đặt lịch khám với Hệ thống Y tế Thu Cúc TCI trên Nền tảng Y tế Chăm sóc sức khỏe toàn diện BookingCare:\n\n* Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm\n* Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch) \n* Khám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng\n* Nhận được hướng dẫn đi khám chi tiết sau khi đặt lịch', 'data:image/jpeg;base64,', 'Hệ thống Y tế Thu Cúc TCI', '2023-04-23 17:24:56', '2023-04-23 17:24:56');
