INSERT INTO "MarkDowns" ("id", "contentHTML", "contentMarkDown", "description", "doctorId", "specialtyId", "clinicId", "createdAt", "updatedAt") VALUES
(1, '<p><strong>Bác sĩ Chuyên khoa II Trần Minh Khuyên</strong></p>\n<ul>\n<li>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</li>\n<li>Bác sĩ nhận khám từ 16 tuổi trở lên</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</li>\n<li>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n</ul>\n', '**Bác sĩ Chuyên khoa II Trần Minh Khuyên**\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n**Quá trình đào tạo**\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n**Quá trình công tác**\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.', 'Bác sĩ Chuyên khoa II Trần Minh Khuyên\nNguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 18, NULL, NULL, '2023-04-06 17:39:04', '2023-04-07 16:13:51'),
(7, '<p><strong>Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng\nPhó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu</strong></p>\n<ul>\n<li>Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương</li>\n<li>Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương</li>\n<li>Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan</li>\n<li>Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu</li>\n<li>Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới</li>\n<li>Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội</li>\n<li>Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ</li>\n<li>Tốt nghiệp Đại học Y Hà Nội (1977)</li>\n<li>Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam</li>\n<li><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/0/00/%D0%A1%D0%B2%D0%B5%D1%82_%D0%BE%D1%82_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D0%B8_-_panoramio.jpg/640px-%D0%A1%D0%B2%D0%B5%D1%82_%D0%BE%D1%82_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D0%B8_-_panoramio.jpg\" alt=\"img\"></li>\n</ul>\n', '**Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng\nPhó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu**\n* Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\n* Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\n* Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan\n* Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu\n* Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới\n* Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội\n* Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ\n* Tốt nghiệp Đại học Y Hà Nội (1977)\n* Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam\n* ![img](https://upload.wikimedia.org/wikipedia/commons/thumb/0/00/%D0%A1%D0%B2%D0%B5%D1%82_%D0%BE%D1%82_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D0%B8_-_panoramio.jpg/640px-%D0%A1%D0%B2%D0%B5%D1%82_%D0%BE%D1%82_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D0%B8_-_panoramio.jpg)', 'Giáo sư, Tiến sĩ, Bác sĩ cao cấp Nguyễn Duy Nam\nNguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\nBác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\nNguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam', 21, NULL, NULL, '2023-04-07 14:35:06', '2023-04-07 16:25:27'),
(8, '<p><strong>PGS, TS, Giảng viên cao cấp Trần Hữu Bình</strong></p>\n<ul>\n<li>Danh hiệu Thầy thuốc Nhân dân</li>\n<li>Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh</li>\n<li>Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai</li>\n<li>Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội</li>\n<li>Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai</li>\n<li>Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội</li>\n<li>Viện trưởng Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (2008 – 2011)</li>\n<li>Trưởng khoa điều trị Nghiện chất Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2010 – 2014)</li>\n<li>Trưởng khoa điều trị loạn thần Nam Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (1995 – 2008)</li>\n<li>Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1995 - 2014)</li>\n<li>Bác sĩ – cán bộ giảng dạy, Bộ môn Tâm thầnTrường Đại học Y Hà Nội (1978 - 1994)</li>\n</ul>\n', '**PGS, TS, Giảng viên cao cấp Trần Hữu Bình**\n* Danh hiệu Thầy thuốc Nhân dân\n* Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh\n* Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai\n* Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội\n\n**Quá trình công tác**\n\n* PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội\n* Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai\n* Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội\n* Viện trưởng Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (2008 – 2011)\n* Trưởng khoa điều trị Nghiện chất Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2010 – 2014)\n* Trưởng khoa điều trị loạn thần Nam Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (1995 – 2008)\n* Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1995 - 2014)\n* Bác sĩ – cán bộ giảng dạy, Bộ môn Tâm thầnTrường Đại học Y Hà Nội (1978 - 1994)', 'PGS, TS, Giảng viên cao cấp Trần Hữu Bình\nBác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh\nNguyên Viện trưởng Viện Sức khỏe Tâm thần quốc gia, Bệnh viện Bạch Mai\nNguyên Phó Chủ nhiệm Bộ môn Tâm thần trường Đại học Y Hà Nội', 23, NULL, NULL, '2023-04-07 16:23:35', '2023-04-07 16:23:35'),
(9, '<p>Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An\nPhó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng\nNguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\nTrên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương\nBác sĩ Nội trú chuyên ngành Tai Mũi Họng\nBác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng</p>\n', 'Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An\nPhó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng\nNguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\nTrên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương\nBác sĩ Nội trú chuyên ngành Tai Mũi Họng\nBác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng', 'Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An\nNguyên Trưởng khoa Tai mũi họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\nTrên 25 năm công tác tại Bệnh viện Tai mũi họng Trung ương\nChuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn và trẻ em', 28, NULL, NULL, '2023-04-22 08:14:37', '2023-04-22 08:14:37'),
(10, '<p>Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An\nPhó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng\nNguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\nTrên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương\nBác sĩ Nội trú chuyên ngành Tai Mũi Họng\nBác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng</p>\n', 'Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An\nPhó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng\nNguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\nTrên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương\nBác sĩ Nội trú chuyên ngành Tai Mũi Họng\nBác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng', 'Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An\nNguyên Trưởng khoa Tai mũi họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\nTrên 25 năm công tác tại Bệnh viện Tai mũi họng Trung ương\nChuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn và trẻ em', 28, NULL, NULL, '2023-04-22 08:17:33', '2023-04-22 08:17:33');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkDown", "createdAt", "updatedAt") VALUES
(2, 'Cơ Xương Khớp', 'data:image/jpeg;base64,', '<p><strong>Cơ Xương Khớp</strong></p>\n<p><strong>Bác sĩ Cơ Xương Khớp giỏi</strong></p>\n<p>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</li>\n<li>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p><strong>Bệnh Cơ Xương Khớp</strong>\nGout\nThoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</p>\n<ul>\n<li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li>\n<li>Loãng xương, đau nhức xương</li>\n<li>Viêm xương, gai xương</li>\n<li>Viêm cơ, Teo cơ, chứng đau mỏi cơ</li>\n<li>Yếu cơ, Loạn dưỡng cơ</li>\n<li>Các chấn thương về cơ, xương, khớp</li>\n</ul>\n', '**Cơ Xương Khớp**\n\n**Bác sĩ Cơ Xương Khớp giỏi**\n\nDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm\n* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n**Bệnh Cơ Xương Khớp**\nGout\nThoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ\n* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n* Loãng xương, đau nhức xương\n* Viêm xương, gai xương\n* Viêm cơ, Teo cơ, chứng đau mỏi cơ\n* Yếu cơ, Loạn dưỡng cơ\n* Các chấn thương về cơ, xương, khớp\n', '2023-04-20 15:14:06', '2023-04-20 15:14:06');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkDown", "createdAt", "updatedAt") VALUES
(4, 'Tiêu hoá', 'data:image/jpeg;base64,', '<p>Bác sĩ Chuyên khoa Tiêu hóa\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\nCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\nTư vấn, khám và điều trị các Bệnh Tiêu hóa</p>\n<p>Ăn uống kém, không ngon\nRối loạn tiêu hóa, táo bón, trĩ\nNhiễm vi khuẩn HP (Helicobacter pylori)\nNội soi dạ dày, đại tràng, tiêu hóa\nBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\nCo thắt thực quản, Hội chứng ruột kích thích\nĐau bụng, dạ dày, đại tràng, thượng vị\nViêm đại tràng, dạ dày, tá tràng\nUng thư dạ dày, U nang tuyến tụy\nBệnh lý về gan, mật</p>\n', 'Bác sĩ Chuyên khoa Tiêu hóa\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\nCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\nTư vấn, khám và điều trị các Bệnh Tiêu hóa\n\nĂn uống kém, không ngon\nRối loạn tiêu hóa, táo bón, trĩ\nNhiễm vi khuẩn HP (Helicobacter pylori)\nNội soi dạ dày, đại tràng, tiêu hóa\nBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\nCo thắt thực quản, Hội chứng ruột kích thích\nĐau bụng, dạ dày, đại tràng, thượng vị\nViêm đại tràng, dạ dày, tá tràng\nUng thư dạ dày, U nang tuyến tụy\nBệnh lý về gan, mật', '2023-04-20 15:20:00', '2023-04-20 15:20:00');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkDown", "createdAt", "updatedAt") VALUES
(5, 'Tim mạch', 'data:image/jpeg;base64,', '<p>Bác sĩ tim mạch giỏi\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\nCác giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\nĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\nKhám tư vấn tim mạch</p>\n<p>Khó thở, Đau ngực, đau tim\nTăng huyết áp, hạ huyết áp\nRối loạn mỡ máu, cao huyết áp, chóng mặt\nBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\nCảm giác hồi hộp, tim đập nhanh<br>\nTim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến<br>\nĐã đặt stent tim, nong động mạch vành\nGiãn tĩnh mạch chân<br>\n...</p>\n', 'Bác sĩ tim mạch giỏi\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\nCác giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\nĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\nKhám tư vấn tim mạch\n\nKhó thở, Đau ngực, đau tim\nTăng huyết áp, hạ huyết áp\nRối loạn mỡ máu, cao huyết áp, chóng mặt\nBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\nCảm giác hồi hộp, tim đập nhanh   \nTim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến   \nĐã đặt stent tim, nong động mạch vành\nGiãn tĩnh mạch chân   \n...', '2023-04-20 15:20:20', '2023-04-20 15:20:20');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkDown", "createdAt", "updatedAt") VALUES
(6, 'Châm cứu', 'data:image/jpeg;base64, ', '<p>Bác sĩ Châm cứu giỏi</p>\n<p>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\nCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\nTư vấn, khám và điều trị các vấn đề:</p>\n<p>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\nBệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\nBệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\nBệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa..</p>\n', 'Bác sĩ Châm cứu giỏi\n\nBác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\nCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\nTư vấn, khám và điều trị các vấn đề:\n\nBệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\nBệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\nBệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\nBệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa..', '2023-04-20 15:24:09', '2023-04-20 15:24:09');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkDown", "createdAt", "updatedAt") VALUES
(7, 'Thần kinh', 'data:image/jpeg;base64,', '<p>Bác sĩ Thần kinh giỏi\nDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</p>\n<p>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\nKhám bệnh chuyên khoa Thần kinh\nBại Não<br>\nĐau đầu, chóng mặt, buồn nôn<br>\nBệnh Pakison, bệnh tiền đình<br>\nBị co cơ, căng dây thần kinh<br>\nĐộng kinh, có những cơn vãng ý thức<br>\nBị tê bì nửa mặt, chèn dây thần kinh\nBồn chồn, lo lắng, hồi hộp, chân tay run<br>\nCó dấu hiệu tăng động<br>\nCo rút cổ, đau đầu với mặt, chân tay, vã mồ hôi<br>\nChấn thương đầu, dây thần kinh</p>\n', 'Bác sĩ Thần kinh giỏi\nDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:\n\nCác giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\nKhám bệnh chuyên khoa Thần kinh\nBại Não   \nĐau đầu, chóng mặt, buồn nôn   \nBệnh Pakison, bệnh tiền đình   \nBị co cơ, căng dây thần kinh       \nĐộng kinh, có những cơn vãng ý thức   \nBị tê bì nửa mặt, chèn dây thần kinh\nBồn chồn, lo lắng, hồi hộp, chân tay run   \nCó dấu hiệu tăng động    \nCo rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   \nChấn thương đầu, dây thần kinh', '2023-04-20 15:58:06', '2023-04-20 15:58:06');
